import React from 'react';
import Head from "next/head";
import Header from "../includes/Header/Header";

const MainLayout = props => {
    return (
        <>
            <Head>
                <title>Website Title</title>
            </Head>
            <Header/>
            <div className="container">
                { props.children }
            </div>


        </>
    );
};

export default MainLayout;
